  const heading = {
    headingData:"Why to Choose Ftechiz for Android App Development Services?",
  };
  const para = {
    paraData:"It has been over 6 years since we started developing Android Applications for our valuable clients. Over the years, we have designed and developed 50+ applications in different categories ranging from e-Commerce, On-Demand Delivery, Taxi & Travel, Healthcare, Education, and several other industries. As a leading Android App Development Company, Ftechiz have a squad of app developers to create well-researched, user-friendly and robust mobile apps for client businesses to boom.",
  };
  const para2 = {
    paraData:"You do not need to search now like Android App Development Company near me, as top Mobile App Development Company, we make sure to excel in the provision of our services like Android Consulting, Native/ Custom/ Hybrid Android App Development, and Android UI/UX Design. With high customer trust and satisfaction, Ftechiz have been able to transform various start-ups and organizations around the world. We help businesses to find solutions using latest technology, and to be more specific that is using Android apps that will help them to run their business smoothly and much more efficiently.",
  };
  const para3 = {
    paraData:"Our highly skilled android app developers know all the ins and outs of the Android Platform. Our developers have all the working experience of the major Android device, types, and brands. We assure our client of a reliable product that connects to the platform’s users.",
  };
  return (
    <>
      <Wrapper>
        <Para_Heading heading={heading} para={para} para2={para2} para3={para3}/>
      </Wrapper>
    </>
  );
};
const Wrapper = styled.section``;
export default Why_To_Choose;
